package week1.day2;

public class FindOddNumbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int num =10;
		for(int i=1;i<=num;i++)
		{
			if(i%2!=0)
			{
				System.out.println("Odd numbers:"+i);
			}
			//else if(i%2==0)
			//{
			//	System.out.println("even numbers:"+i);
			//}
		}

	}

}
